import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
// import "./VideoList.css"; // Import the CSS file here

const VideoList = () => {
  const [videos, setVideos] = useState([]);
  const apiKey = "AIzaSyBVIOEDjrULYj_7yyTKCsUZswI6zyvlaVE";

  useEffect(() => {
    const cachedVideos = localStorage.getItem("videos");
    if (cachedVideos) {
      setVideos(JSON.parse(cachedVideos));
    } else {
      fetchVideos();
    }
  }, []);

  const fetchVideos = async () => {
    try {
      const params = {
        key: apiKey,
        part: "snippet",
        q: "John Mayer 2019 Live",
        type: "video",
        maxResults: 3,
      };
      const response = await axios.get(
        "https://www.googleapis.com/youtube/v3/search",
        { params }
      );

      console.log(
        "Request URL:",
        `https://www.googleapis.com/youtube/v3/search?${new URLSearchParams(
          params
        ).toString()}`
      );

      localStorage.setItem("videos", JSON.stringify(response.data.items));
      setVideos(response.data.items);
    } catch (error) {
      console.error("Error fetching videos:", error);
      if (error.response) {
        console.log("Error Response Data:", error.response.data);
      }
    }
  };

  const handleMoreVideos = () => {
    localStorage.removeItem("videos"); // Clear cached videos
    fetchVideos(); // Fetch new videos
  };

  return (
    <div>
      <div className="video-grid">
        {videos.map((video) => (
          <div key={video.id.videoId} className="video-container">
            <Link
              to={`/video/${encodeURIComponent(video.id.videoId)}`}
              className="video-link"
            >
              <img
                src={video.snippet.thumbnails.high.url}
                alt={video.snippet.title}
                className="video-thumbnail"
              />
              <p className="video-title">{video.snippet.title}</p>
            </Link>
          </div>
        ))}
      </div>
      <button onClick={handleMoreVideos} className="more-videos-button">
        More Videos
      </button>
    </div>
  );
};

export default VideoList;
